    onSearch_by_townTap: function(button, e, eOpts) {

        var WebUrl='http://www.savoursqc.com.au/MobileJSONData/GetAllTowns/'
        $.getJSON(WebUrl,null,function(towns){ 
            var store = Ext.create('Ext.data.Store', {model: 'MyApp.model.Towns',data: towns,                                             
                grouper: {groupFn: function(item) {return item.get('RegionName');}}
            });



            var CLIST = Ext.getCmp("towns_list");
            CLIST.setStore(store); 
            CLIST.refresh();
        });



        this.push(Ext.create('MyApp.view.TownsPage',{
            title:'Nearby'
        }));
    },

